import { Button, FormControlLabel, TextField } from '@mui/material';
import Box from '@mui/material/Box';
import Checkbox from '@mui/material/Checkbox';
import React from 'react';


const Form = () => {
    function RedBar() {
        return (
          <Box
            sx={{
              height: 20,
              backgroundColor: 'transparent'
            }}
          />
        );
    }

  return (
    <div className="form">
    <div className="form__details">
        <h2>Create an account</h2>
      <form>
        <RedBar/>
        <div class="form--text">
        <label for="email">Your email Address</label>
        <input type="text" id="email" name="email" placeholder="Enter your Email Address" />
        </div>
        <RedBar/>
        <div class="form--text">
        <label for="password">Your password</label>
        <input type="password" id="password" name="password" placeholder="Enter your password" />
        </div>    
        <RedBar/>
        <TextField fullWidth label='Confirm your Password' type="password" id="standard-password-input" placeholder="Enter your Confirm Password" />
        <RedBar/>
        
        <RedBar/>
        <div class="form--text">
        <label for="name">Your name</label>
        <input type="text" id="name" name="name" placeholder="Enter your Name" />
        </div>
        <TextField label='Your phone number' placeholder="Enter your Phone Number" inputProps={{ inputMode: 'numeric', pattern: '[0-9]*' }}/>
        <RedBar/>
        <FormControlLabel
          value="end"
          control={<Checkbox />}
          label="I have read and agree Terms and Conditions"
          labelPlacement="I have read and agree Terms and Conditions"
          size="small"
        />
        <RedBar/>
        <Button type='submit' variant='contained' color='primary'>Create Account</Button>
      </form>
    </div>
    </div>
  )
}

export default Form;
